import React from 'react'
import {Line} from "react-chartjs-2";

function LineGraph() {
  
  
    const data =[{
        x: 10,
        y: 20
    },{
        x: 15,
        y: 10
    }]
    return (
        <div className="Linegraph">

        <Line
            data={{
                datasets:[
                    {
                        type: "line",
                        data: data
                    }
                ]
            }}
        />
            
        </div>
    )
}

export default LineGraph;
